    [],nt"revision_timestamp": "2016-08-08T20:46:20.136792",nt"name": "western-pacific-typhoon-aircraft-fixes",nt"isopen":
    false,nt"url": null,nt"notes": "Western Pacific typhoon aircraft reconnaissance
    data from the years 1946 - 1965 and 1978, excluding 1952, were transcribed from
    original documents, or copy of original documents, into a spreadsheet. Microfilm
    and paper documents were inspected for reconnaissance aircraft fixes and other data
    collected during flight. Data was collected from reports such as, tropical cyclone
    consolidated reports, annual typhoon reports, storm summary and life history of
    the typhoon reports, and aircraft weather code charts. Unfortunately, data for the
    year of 1952 could not be found, data for the year of 1955 is very limited, and
    data for the year of 1978 was incomplete in its digitized format. This dataset is
    a compilation of datasets that are present in paper and microfilm format located
    at Asheville's National Climatic Data Center archive, but is not easily accessible
    to the public. Part of the dataset also exists, and is available to the public at
    the Joint Typhoon Warning Center website in a pdf format. However, those data are
    not available in a digitized format.",nt"license_title": null,nt"extras":
